- input: "TEXT\x1CC00041160\x1C1\x1C\x1CF3XA\x1CThe disbursements on Schedule B line
    21b are neither for any Federal Election Activity nor do the disbursements promote,
    attack, support, or oppose any Federal Elected Official or any Federal Candidate.
    \ The employees reported on the H4 are working less than 25 percent of their compensated
    time in a given month on Federal election activity or activities in connection
    with a Federal election.  The expenditure to Zeeland Record was to pay a debt
    for a candidate that has a closed committee.  Per 11 CFR 106.6e2 and 106.7f2 transfers
    from the non-federal account to the federal account must be made within 60 days
    after the payment to the vendor, and no earlier than 10 days before the payment
    is made.  The Michigan Republican Party follows the requirements of the law.  Transfers
    from our Non-Federal Account for administrative split disbursements did occur
    within 60 days of the payment to the vendor.  On 2.5.09, we issued a new check
    to the Isabella County Republican Party to replace the check we issued on 10.15.08.
    \ The original check was for 3 months of FMV rent, when in fact we only owed for
    2 months of FMV rent.  The 2.5.09 check was the accurate payment for 2 months
    FMV rent.   \n"
